/**
 * groups symbols by type
 * @returns {object}
 */
const _getEmojiByType = () => {
  let obj = {};
  (SimpleEmojiList || []).forEach((emoji) => {
    let emojitype = emoji.type || "";
    obj[emojitype] = obj[emojitype] || [];
    obj[emojitype].push({
      ...emoji,
    });
  });
  return obj;
};
/**
 * symbols grouped by type
 */
export const EmojiByType = _getEmojiByType();
